INSERT INTO `block_data` (`id`, `block_id`, `language`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, 1, 'vi', 'Tư vấn du học tổng quát', '<h4><br></h4>', NULL, '2017-11-03'),
(2, 1, 'en', 'en - Tư vấn du học tổng quát', 'en - Đánh thức giấc mơ cổ tích tại \"Xứ sở thần tiên\"', NULL, NULL),
(3, 2, 'vi', 'Tư vấn ngành', NULL, NULL, '2017-11-03'),
(4, 2, 'en', 'en - Tư vấn ngành', 'en - tu van nghanh - Đánh thức giấc mơ cổ tích tại \"Xứ sở thần tiên\"', NULL, NULL),
(5, 3, 'vi', 'SĂN HỌC BỔNG', '<h4><font face=\"Times New Roman\" color=\"#000000\">Với chính sách visa rộng mở, Canada hiện thu hút được hàng trăm ngàn du học sinh từ khắp các quốc gia trên thế giới. Tuy nhiên, Dù sở hữu môi trường học tập hiện đại bậc nhất thế giới nhưng các trường tại Canada vẫn luôn duy trì mức học phí thấp hơn hẳn các quốc gia nói tiếng Anh khác. Đây có thể coi là một trong số những lý do khiến nước này khá “khiêm tốn” trong việc cấp học bổng cho sinh viên quốc tế.<br>Để được tư vấn thông tin chi tiết nhất về săn học bổng du học Canada, bạn hãy nhanh tay liên hệ với NVE theo số hotline: 0901.799.666 để được tư vấn chi tiết.</font></h4>', NULL, '2017-11-07'),
(6, 3, 'en', 'ev', NULL, NULL, '2017-10-22'),
(7, 4, 'vi', 'TIỀM LỰC TÀI CHÍNH LỚN MẠNH', 'NVEDUCATION có Công ty chủ quản là NVHOMES – đơn vị phân phối BĐS hàng đầu Việt Nam Hiện nay với doanh số trên 300 tỷ đồng/năm ', '2017-10-01', '2017-11-06'),
(8, 4, 'en', NULL, '<p>weeeee</p>', '2017-10-01', '2017-11-06'),
(9, 5, 'vi', 'PHÍ DỊCH VỤ CẠNH TRANH NHẤT', '<p><font color=\"#ffffff\">Là đơn vị chuyên nghiệp, với nhiều ưu thế, không qua trung gian, NVEDUCATION có bảng giá dịch vụ cạnh tranh nhất thị trường&nbsp;<br></font></p><p><br></p>', '2017-10-01', '2017-11-06'),
(10, 5, 'en', NULL, NULL, '2017-10-01', '2017-10-01'),
(11, 6, 'vi', 'TẬN TÂM VÀ CHUYÊN NGHIỆP', '<p>Đội ngũ CBNV tận tình và chuyên nghiệp, luôn hỗ trợ offline và trực tuyến bất kể thời gian nào cho các bậc phụ huynh và học sinh, sinh viên.</p><div><br></div>', '2017-10-01', '2017-11-06'),
(12, 6, 'en', NULL, NULL, '2017-10-01', '2017-10-01'),
(13, 7, 'vi', 'Quản lý dự án', NULL, '2017-10-16', '2017-10-16'),
(14, 7, 'en', 'project manager', NULL, '2017-10-16', '2017-10-16'),
(15, 8, 'vi', 'Trợ lý', NULL, '2017-10-16', '2017-10-16'),
(16, 8, 'en', 'Assistant', '<p><br></p>', '2017-10-16', '2017-10-16'),
(17, 9, 'vi', 'chuyên viên', NULL, '2017-10-16', '2017-10-16'),
(18, 9, 'en', 'Specialist', NULL, '2017-10-16', '2017-10-16'),
(19, 10, 'vi', 'CÓ KINH NGHIỆM LÂU NĂM TRONG LĨNH VỰC DU LỊCH', '<p>NVEDUCATION được sự hậu thuẫn từ HADO Holidays – đơn vị uy tín trong lĩnh vực du lịch, hỗ trợ đắc lực về chính sách nhập cảnh và thông tin địa điểm đến tại Canada</p><div><br></div>', '2017-11-06', '2017-11-06'),
(20, 10, 'en', NULL, NULL, '2017-11-06', '2017-11-06'),
(21, 11, 'vi', 'CÓ ĐẠI DIỆN TẠI CANADA', '<p>Với việc có đại diện tại Canada, NVEDUCATION có ưu thế trong việc hỗ trợ sinh viên tại nơi các bạn đến sinh sống, học tập.</p><div><br></div>', '2017-11-06', '2017-11-06'),
(22, 11, 'en', NULL, NULL, '2017-11-06', '2017-11-06'),
(23, 12, 'vi', 'ĐA DẠNG CÁC LỰA CHỌN VỀ TRƯỜNG HỌC', '<p>NVEDUCATION đặt đối tác chiến lược với các trường cao đẳng trong CES và các trường trung học, đại học hàng đầu tại Canada</p><div><br></div>', '2017-11-06', '2017-11-06'),
(24, 12, 'en', NULL, NULL, '2017-11-06', '2017-11-06'),
(25, 13, 'vi', 'Hỗ trợ khách hàng đi tốt nhất', NULL, '2018-02-28', '2018-02-28'),
(26, 14, 'vi', 'Am hiểu sâu sắc dự án, tư vấn căn hộ phù hợp nhất, chọn căn đẹp, hợp phong thủy', NULL, '2018-02-28', '2018-02-28'),
(27, 15, 'vi', 'Luôn đồng hành cùng khách hàng, tận tình chăm sóc và tư vấn khách hàng cùng sách bán hàng vượt trội, hấp dẫn', NULL, '2018-02-28', '2018-02-28'),
