INSERT INTO `news` (`id`, `content`, `image`, `image_thumb`, `summary`, `user_id`, `category_id`, `active`, `keyword`, `description`, `front`, `type`, `landingpage_id`, `updated_at`, `created_at`, `number`) VALUES
(1, '<h1 style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px; text-align: center;\">\r\n	<span style=\"color:#0000ff;\"><span style=\"font-size:18px;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong style=\"font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;\">Công Ty TNHH Kinh Doanh Thương Mại và Dịch Vụ Tân Thành<span style=\"font-size:14px;\">&nbsp;</span></strong><strong><span style=\"font-size:14px;\">Với hơn 5 năm trong lĩnh vực phần cứng laptop chúng tôi cam kết với &nbsp;khách hàng</span></strong></span></span></h1>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-size: 14pt;\">+ Chúng tôi luôn đặt chất lượng các sản phẩm lên hàng đầu.</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-size: 14pt;\">+ Không bán hàng nhái. hàng chất lượng kém. gây ảnh hưởng tới máy trong quá trình sử dụng</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-size: 14pt;\">+ Tuổi thọ của sản phẩm không phụ thuộc vào thời gian bảo hành,</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-size: 14pt;\">+ Bảo hành nhanh, nghiêm túc</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-size: 14pt;\">+ Giao hàng và lắp đặt tận nhà hoàn toàn miễn phí trong nội thành Hà Nội</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-size: 14pt;\">+ Hỗ trợ 50% chi phí vận chuyển đối với khách hàng ở các tỉnh ngoài Hà Nội</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px; margin-bottom: 12pt;\">\r\n	<span style=\"font-size: 14pt;\">+ Mọi yêu cầu đặt hàng và hỗ trợ tư vấn quý khách vui lòng liên hệ qua số:<em>&nbsp;</em><span style=\"font-size: 20px;\"><span style=\"color: rgb(255, 0, 0);\"><em>0989710690</em></span></span></span></p>\r\n', 'http://saclaptop.net/img/news/pin%20laptop.jpg', '', '', 5, 100, 1, 'Công Ty TNHH Kinh Doanh Thương Mại và Dịch Vụ Tân Thành ', 'Giao hàng và lắp đặt tận nhà hoàn toàn miễn phí trong nội thành Hà Nội Hỗ trợ 50% chi phí vận chuyển đối với khách hàng ở các tỉnh ngoài Hà Nội\r\n\r\n', 0, '0', 0, NULL, NULL, 0),
(26, '<p>\r\n	Chỉ 5 ngày kể từ sau thời điểm mở bán iPhone 6s trên thế giới, iPhone 6s Lock Nhật đã bắt đầu manh nha xuất hiện trên các khu chợ mua bán đồ công nghệ online nổi tiếng.</p>\r\n<p>\r\n	Qua trao đổi với 1 chủ cửa hàng trên website Nhật Tảo, chúng tôi được biết hầu hết máy iPhone 6s Lock Nhật đang có mặt ở Việt Nam hiện nay có xuất xứ từ nhà mạng Docomo hoặc Softbank giống như lô hàng iPhone cũ đã từng gây sốt mạnh tại thị trường trong nước.</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_149060\" rel=\"http://genknews.vcmedia.vn/2015/capture-1443536206937.PNG\" src=\"http://genknews.vcmedia.vn/k:thumb_w/640/2015/capture-1443536206937/iphone-6s-lock-nhat-bat-ngo-xuat-hien-tai-viet-nam-gia-165-trieu.PNG\" style=\"max-width: 100%; cursor: none;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Hiện tại một chiếc iPhone 6s Lock Nhật màu Rose Gold có giá là 16,5 triệu đồng cho bản dung lượng thấp nhất. Theo chủ cửa hàng, phiên bản màu Gold cũng chỉ rẻ hơn khoảng 300 ngàn, nên gần như không ai muốn mạo hiểm bán bản màu vàng sâm panh thông thường cả.</p>\r\n<p>\r\n	Trong khi đó, giá cả bản quốc tế của iPhone 6s tại thị trường Việt Nam đang giảm giá 1 cách chóng mặt, sau năm ngày bán ra, sản phẩm đã tụt từ khoảng hơn 40 triệu đồng xuống còn hơn 18 triệu đồng và tiếp tục có dấu hiệu giảm thêm khi mà giá iPhone chính hãng đã có nhiều đồn đoán.</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_149062\" rel=\"http://genknews.vcmedia.vn/2015/11121542-10203672907343177-18036693-n-1443107336321.jpg\" src=\"http://genknews.vcmedia.vn/k:thumb_w/640/2015/11121542-10203672907343177-18036693-n-1443107336321/iphone-6s-lock-nhat-bat-ngo-xuat-hien-tai-viet-nam-gia-165-trieu.jpg\" style=\"max-width: 100%; cursor: none;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Anh Muộn, đại diện cửa hàng MS Mobile cho biết: <em>&quot;Thời điểm hiện tại đến iPhone 6 lock đang được bán với giá hơn 9 triệu đồng còn chưa tạo được sự đột phá gì thì iPhone 6s lock giá như vậy là quá cao. Hơn nữa, chỉ khoảng 1 tuần sau là bản quốc tế về nhiều và giá sẽ còn giảm mạnh hơn thậm chí xuống dưới mốc 16 triệu đồng&quot;.</em></p>\r\n<p>\r\n	Đồng quan điểm với anh Muộn, Anh Sơn, chủ cửa hàng Mobile City cũng cho rằng: <em>&quot;Tôi chẳng có lý do gì để mua một chiếc iPhone lock với giá 16,5 triệu cả. Những người sẵn sàng bỏ ra gần 20 triêu để mua iPhone 6s họ sẽ chằng tiếc rẻ gì khoảng 15% giá thành để sở hữu một chiếc điện thoại lock vĩnh viễn cả&quot;.</em></p>\r\n', 'http://saclaptop.net/img/news/pin%20laptop.jpg', '/img/news/iphone-6s-lock-nhat-bat-ngo-xuat-hien-tai-viet-nam-gia-165-trieu.jpg', '', 5, 105, 0, '', '', 0, '0', 0, NULL, NULL, 0),
(27, '<p>\r\n	Một trong những cải tiến lớn nhất của iPhone 6s và 6s Plus là hệ thống camera mới với cảm biến độ phân giải 12 megapixel. Để chứng minh sự thay đổi về chất lượng chụp ảnh trên chiếc smartphone mới này, Lisa Bettany, đồng sáng lập ứng dụng Camera + đã thử nghiệm trên tất cả các đời iPhone và đưa ra kết quả đáng kinh ngạc.</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"Đây là tấm ảnh chụp macro giữa iPhone đời đầu tiên và iPhone 6S.\" id=\"img_148807\" rel=\"http://genknews.vcmedia.vn/2015/iphonecomparison-1443495507581.jpg\" src=\"http://genknews.vcmedia.vn/k:2015/iphonecomparison-1443495507581/camera-iphone-6s-da-cai-tien-the-nao-so-voi-cac-phien-ban-truoc.jpg\" style=\"max-width: 100%; cursor: none;\" type=\"photo\" /></p>\r\n<p class=\"PhotoCMS_Caption\">\r\n	Đây là tấm ảnh chụp macro giữa iPhone đời đầu tiên và iPhone 6S.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Và dưới đây là ảnh so sánh chất lượng chụp macro của iPhone qua các đời máy:</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_148809\" rel=\"http://genknews.vcmedia.vn/2015/iphone-comparison-download-1-1443495507610.jpg\" src=\"http://genknews.vcmedia.vn/k:2015/iphone-comparison-download-1-1443495507610/camera-iphone-6s-da-cai-tien-the-nao-so-voi-cac-phien-ban-truoc.jpg\" style=\"max-width:100%;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_148813\" rel=\"http://genknews.vcmedia.vn/2015/iphone-comparison-download-1443495507597.jpg\" src=\"http://genknews.vcmedia.vn/k:2015/iphone-comparison-download-1443495507597/camera-iphone-6s-da-cai-tien-the-nao-so-voi-cac-phien-ban-truoc.jpg\" style=\"max-width:100%;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ảnh chụp ngược sáng và thiếu sáng cũng cho ra chất lượng tốt hơn:</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_148810\" rel=\"http://genknews.vcmedia.vn/2015/iphone-comparison-download-2-1443495507623.jpg\" src=\"http://genknews.vcmedia.vn/k:2015/iphone-comparison-download-2-1443495507623/camera-iphone-6s-da-cai-tien-the-nao-so-voi-cac-phien-ban-truoc.jpg\" style=\"max-width:100%;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_148811\" rel=\"http://genknews.vcmedia.vn/2015/iphone-comparison-download-4-1443495507560.jpg\" src=\"http://genknews.vcmedia.vn/k:2015/iphone-comparison-download-4-1443495507560/camera-iphone-6s-da-cai-tien-the-nao-so-voi-cac-phien-ban-truoc.jpg\" style=\"max-width:100%;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Đối với ảnh chụp chân dung, iPhone 6s tái tạo màu chính xác hơn và giảm bớt tình trạng nhiễu hạt. Khi phóng to và nhìn vào vùng nhãn cầu, có thể thấy rõ iPhone 6 cho độ nét tốt hơn rất nhiều.</p>\r\n<p class=\"VCSortableInPreviewMode\" style=\"display: inline-block; width: 640px; text-align: center; box-sizing: border-box;\" type=\"Photo\">\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" id=\"img_148812\" rel=\"http://genknews.vcmedia.vn/2015/iphone-comparison-download-3-1443495507634.jpg\" src=\"http://genknews.vcmedia.vn/k:2015/iphone-comparison-download-3-1443495507634/camera-iphone-6s-da-cai-tien-the-nao-so-voi-cac-phien-ban-truoc.jpg\" style=\"max-width: 100%; cursor: none;\" type=\"photo\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&quot;Cải tiến cảm biến, nâng cấp phần mềm và vi xử lý A9 trên iPhone 6 cũng góp phần giúp cho chất lượng camera được hoàn hảo hơn&quot;, Bettany cho biết. &quot;Tốc độ lấy nét tự động cũng nhanh hơn đáng kể, bên cạnh đó là sự cải tiến về độ chính xác màu, chi tiết và độ nét, đặc biệt là trong điều kiện ánh sáng yếu&quot;.</p>\r\n', 'http://saclaptop.net/img/news/pin%20laptop.jpg', '/img/news/iphone-6s-lock-nhat-bat-ngo-xuat-hien-tai-viet-nam-gia-165-trieu.jpg', '\"Cải tiến cảm biến, nâng cấp phần mềm và vi xử lý A9 trên iPhone 6 cũng góp phần giúp cho chất lượng camera được hoàn hảo hơn\", Bettany cho biết.', 5, 105, 0, '', '', 0, '0', 0, NULL, NULL, 0),
(30, '<h2>\r\n	<span style=\"color:#0000ff;\"><span style=\"font-size:20px;\"><strong>Cách khắc phục lỗi pin laptop Asus bị gạch chéo</strong></span></span></h2>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Laptop của bạn đang sử dụng bỗng nhiên lại xuất hiện biểu tượng pin laptop ở góc màn hình desktop xuất hiện dấu gạch chéo đỏ dù pin vẫn hoạt động bình thường, điều này làm cho bạn cảm thấy bực bội và khó chịu. Nhưng các bạn đừng lo, với những cách mà chúng tôi chia sẻ dưới đây, bạn hoàn toàn có thể tự khắc phục lỗi </span><span style=\"font-size: 14px;\">pin laptop Asus Dell HP Lenovo... bị gạch chéo</span><span style=\"font-size: 14px;\"> ngay tại nhà.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><strong style=\"color: rgb(0, 0, 255);\">Cách 1: tùy chỉnh trong Power Options</strong></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click chuột vào biểu tượng pin =&gt; chọn More Power Options</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Chọn Change Advanced Power Settings =&gt; cửa sổ Power Options mở ra</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Kéo xuống dưới, click vào dấu “+” nhỏ trước Battery</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Tiếp tục Click vào dấu “+” nhỏ trước Low Battery Level =&gt; chỉnh lại On Battery và Plugged In đều là 10%</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Click vào dấu “+” nhỏ trước Critical Battery Level =&gt; chỉnh lại On Battery và Plugged In đều là 5%</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Chọn OK để kết thúc</span></p>\r\n<p>\r\n	<img alt=\"\" src=\"/app/webroot/img/ck/pin%20dell/pin%20laptop%20gach%20cheo.png\" style=\"width: 344px; height: 82px;\" /><img alt=\"\" src=\"/app/webroot/img/ck/pin%20dell/pin%20laptop.jpg\" style=\"width: 344px; height: 387px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<h3>\r\n	<span style=\"color:#0000ff;\"><strong>Cách 2: Update Windows (pin laptop xuất hiện dấu chéo đỏ có thể là do lỗi Win)</strong></span></h3>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click chuột phải vào Computer chọn Properties</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Chọn Windows Update</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Nhấn vào Check for Update rồi để windows tự động update từ hệ thống trang chủ ( cần có mạng)</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Tải xong nhấn Resets, để máy tự khởi động và sửa lỗi, quá trình này diễn ra hơi lâu</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Sau khi fix lỗi xong click vào biểu tượng pin xuất hiện dòng chữ “warn me if my battery may need replacement” bỏ dấu tích đằng trước sau đó biểu tượng gạch chéo đỏ sẽ bị mất</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Các bạn lưu ý, khi Windows thông báo “Consider replacing...” kèm theo pin laptop bị gạch chéo màu đỏ có nghĩa pin laptop của bạn đã bị chai hoặc bị hỏng. Bạn có thể thực hiện theo hướng dẫn trên để bỏ gạch chéo đỏ ở biểu tượng pin. Tuy nhiên, bạn cũng nên chuẩn bị “tâm lý” để thay pin mới cho laptop.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\"><strong style=\"color: rgb(0, 0, 255);\">Cách 3: Gỡ Driver quản lý pin laptop</strong></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click chuột phải vào biểu tượng Computer =&gt; chọn Manage =&gt; hiện cửa sổ Computer Management</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">chọn Device Manager =&gt; chọn Batteries =&gt; Microsoft ACPI-Compliant Control Method Battery =&gt; chọn Disable</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Biểu tượng pin sẽ biến mất</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Sử dụng cạn pin</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Tháo pin ra khỏi máy chờ cho pin hết nóng</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Lắp lại pin vào máy và cắm sạc, trong thời gian chờ sạc đầy pin không bật máy</span></p>\r\n<p>\r\n	<span style=\"font-size:14px;\">Windows sẽ tự động nhận lại driver pin laptop.</span></p>\r\n<h3>\r\n	<span style=\"color:#0000ff;\">Video hướng dẫn Cách khắc phục lỗi pin laptop &nbsp;bị gạch chéo</span></h3>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/L14yoNT_hEo\" width=\"682\"></iframe></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Nếu đã áp ụng tất cả các phương án trên mà vẫn chưa khắc phục được lỗi bạn nên mang đến cửa hàng gần nhất để sửa hoặc các bạn có thể nhấc máy lên và liên hệ ngay với chúng tôi để chúng tôi có thể giúp bạn giải quyết những khó khăn. Hãy nhấc máy lên và gọi ngay cho chúng tôi Hotline :</span><span style=\"font-size: 18px;\"> <span style=\"color:#ff0000;\">0989.710.690</span></span></p>\r\n<p>\r\n	<a href=\"http://saclaptop.net/pin-battery-laptop-asus/lp111.html\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"color:#0000ff;\"><span style=\"font-size:16px;\"><strong><u>===&gt;Pin laptop Asus</u></strong></span></span></span></a></p>\r\n', 'http://saclaptop.net/img/news/pin%20laptop.jpg', '/img/news/pin laptop.jpg', '', 2, 105, 0, 'cách khắc phục lỗi pin laptop Asus bị gạch chéo, pin laptop bị gạch chéo ,cách khắc phục lỗi pin laptop dell bị gạch chéo,cách khắc phục lỗi pin laptop sony bị gạch chéo,cách khắc phục lỗi pin laptop lenovo bị gạch chéo,lỗi pin laptop hp bị gạch chéo', 'cách khắc phục lỗi pin laptop bị gạch chéo  sạc pin không vào điện pin không lưu được điện liên hệ 0989710690 để tư vấn miễn phí  ', 0, '0', 0, NULL, NULL, 0),
