(38, '<h1>\r\n	<span style=\"color: rgb(0, 0, 255);\"><span style=\"font-size: 20px;\">Cách khắc phục lỗi pin laptop bị gạch chéo window 7</span></span></h1>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Laptop của bạn đang sử dụng bỗng nhiên lại xuất hiện biểu tượng pin laptop ở góc màn hình desktop xuất hiện dấu gạch chéo đỏ dù pin vẫn hoạt động bình thường, điều này làm cho bạn cảm thấy bực bội và khó chịu. Nhưng các bạn đừng lo, với những cách mà chúng tôi chia sẻ dưới đây, bạn hoàn toàn có thể tự khắc phục lỗi&nbsp;</span><span style=\"font-size: 14px;\">pin laptop Asus Dell HP Lenovo... bị gạch chéo</span><span style=\"font-size: 14px;\">&nbsp;ngay tại nhà.</span></p>\r\n<h2>\r\n	<span style=\"font-size: 16px;\"><strong style=\"color: rgb(0, 0, 255);\">Cách 1: tùy chỉnh trong Power Options</strong></span></h2>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click chuột vào biểu tượng pin =&gt; chọn More Power Options</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Chọn Change Advanced Power Settings =&gt; cửa sổ Power Options mở ra</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Kéo xuống dưới, click vào dấu “+” nhỏ trước Battery</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Tiếp tục Click vào dấu “+” nhỏ trước Low Battery Level =&gt; chỉnh lại On Battery và Plugged In đều là 10%</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click vào dấu “+” nhỏ trước Critical Battery Level =&gt; chỉnh lại On Battery và Plugged In đều là 5%</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Chọn OK để kết thúc</span></p>\r\n<p>\r\n	<img alt=\"\" src=\"/app/webroot/img/ck/pin%20dell/pin%20laptop%20gach%20cheo.png\" style=\"width: 344px; height: 82px;\" /><img alt=\"\" src=\"/app/webroot/img/ck/pin%20dell/pin%20laptop.jpg\" style=\"width: 344px; height: 387px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<h3>\r\n	<span style=\"color: rgb(0, 0, 255);\">Cách 2: Update Windows (pin laptop xuất hiện dấu chéo đỏ có thể là do lỗi Win)</span></h3>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click chuột phải vào Computer chọn Properties</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Chọn Windows Update</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Nhấn vào Check for Update rồi để windows tự động update từ hệ thống trang chủ ( cần có mạng)</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Tải xong nhấn Resets, để máy tự khởi động và sửa lỗi, quá trình này diễn ra hơi lâu</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Sau khi fix lỗi xong click vào biểu tượng pin xuất hiện dòng chữ “warn me if my battery may need replacement” bỏ dấu tích đằng trước sau đó biểu tượng gạch chéo đỏ sẽ bị mất</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Các bạn lưu ý, khi Windows thông báo “Consider replacing...” kèm theo pin laptop bị gạch chéo màu đỏ có nghĩa pin laptop của bạn đã bị chai hoặc bị hỏng. Bạn có thể thực hiện theo hướng dẫn trên để bỏ gạch chéo đỏ ở biểu tượng pin. Tuy nhiên, bạn cũng nên chuẩn bị “tâm lý” để thay pin mới cho laptop.</span></p>\r\n<p>\r\n	<span style=\"font-size: 16px;\"><strong style=\"color: rgb(0, 0, 255);\">Cách 3: Gỡ Driver quản lý pin laptop</strong></span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Click chuột phải vào biểu tượng Computer =&gt; chọn Manage =&gt; hiện cửa sổ Computer Management</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">chọn Device Manager =&gt; chọn Batteries =&gt; Microsoft ACPI-Compliant Control Method Battery =&gt; chọn Disable</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Biểu tượng pin sẽ biến mất</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Sử dụng cạn pin</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Tháo pin ra khỏi máy chờ cho pin hết nóng</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Lắp lại pin vào máy và cắm sạc, trong thời gian chờ sạc đầy pin không bật máy</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Windows sẽ tự động nhận lại driver pin laptop.</span></p>\r\n<h3>\r\n	<span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 255);\">Video hướng dẫn Cách khắc phục lỗi pin laptop &nbsp;bị gạch chéo window 7</span></span></h3>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/L14yoNT_hEo\" width=\"682\"></iframe></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">Nếu đã áp ụng tất cả các phương án trên mà vẫn chưa khắc phục được lỗi bạn nên mang đến cửa hàng gần nhất để sửa hoặc các bạn có thể nhấc máy lên và liên hệ ngay với chúng tôi để chúng tôi có thể giúp bạn giải quyết những khó khăn. Hãy nhấc máy lên và gọi ngay cho chúng tôi Hotline :</span><span style=\"font-size: 18px;\">&nbsp;<span style=\"color: rgb(255, 0, 0);\">0989.710.690</span></span></p>\r\n<p>\r\n	<a href=\"http://saclaptop.net/pin-battery-laptop-asus/lp111.html\"><span style=\"font-family: \'times new roman\', times, serif;\"><span style=\"color: rgb(0, 0, 255);\"><span style=\"font-size: 16px;\"><strong><u>===&gt;Pin laptop Asus</u></strong></span></span></span></a></p>\r\n', 'http://saclaptop.net/img/news/pin%20laptop.jpg', '/img/news/pin laptop.jpg', '', 2, 105, 0, 'cách khắc phục lỗi pin laptop bị gạch chéo trong window 7,cách khắc phục lỗi pin laptop bị gạch chéo trong window 8,cách khắc phục lỗi pin laptop bị gạch chéo trong window 8.1,cách khắc phục lỗi pin laptop bị gạch chéo trong window 10 ', 'cách khắc phục lỗi pin laptop bị gạch chéo  sạc pin không vào điện pin không lưu được điện liên hệ 0989710690 để tư vấn miễn phí  ', 0, '0', 0, NULL, NULL, 0),
(39, '<h1>\r\n	<span style=\"color:#0000ff;\"><strong>Cách sạc pin laptop Asus mới mua bạn nên biết</strong></span></h1>\r\n<p>\r\n	Vấn đề sử dụng <a href=\"http://saclaptop.net/\"><strong>pin máy tính laptop Asus</strong></a> hiện đang là 1 trong các câu hỏi thông dụng được khá nhiều các bạn quan tâm đến hiện nay. Có nhiều bạn khi mua máy tính mới về nếu không biết cách sử dụng <strong>và cách bảo vệ pin laptop Asus</strong> thì sẽ bị hư 1 cách nhanh chóng. Vì hầu hết các máy tính Asus thế hệ mới bây giờ đều được trang bị viên pin liền, không thể tháo rời, nếu lỡ pin bị chai quá nhanh thì việc thay thế pin mới vào rất khó khăn. Để giúp mọi người có thể sử dụng pin hôm nay chúng tôi xin chia sẻ tới các bạn cách sử dụng <strong>pin máy tính laptop asus</strong> đúng cách.</p>\r\n<h2>\r\n	<span style=\"font-size:16px;\"><span style=\"color:#0000ff;\">1. Cách sạc <strong>pin máy tính laptop Asus</strong> khi mới mua về</span></span></h2>\r\n<p>\r\n	Khi bạn mới mua máy tính bạn nên sạc pin 3 lần, mỗi lần 8 tiếng. Nghĩa là lần đầu tiên bạn sạc 8 tiếng rồi tháo sạc pin ra, sử dụng máy tính đến khi nào máy báo còn 10% pin thì bạn sạc tiếp 8 tiếng nữa, cứ sạc, xả pin như thế trong 3 lần sau đó mới chuyển sang sử dụng máy tính bình thường. Mục đích của việc này là giúp cho pin máy tính được trở về trạng thái hoạt động bình thường, lâu hết pin và lâu bị chai, hư pin.</p>\r\n<p>\r\n	<img alt=\"\" src=\"/app/webroot/img/ck/tin%20t%E1%BB%A9c/Pin-laptop%20moi.jpg\" style=\"width: 344px; height: 155px;\" /><img alt=\"\" src=\"/app/webroot/img/ck/tin%20t%E1%BB%A9c/pin%20laptop%20moi%202.jpg\" style=\"width: 344px; height: 241px;\" /></p>\r\n<h2>\r\n	&nbsp;</h2>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">2. Tại sao pin laptop Asus nhanh chai?</span></h2>\r\n<p>\r\n	Khi bạn sạc pin từ 800 đến 1000 lần thì pin sẽ bị chai khoảng 20%, tức là thời gian sử dụng pin giảm đi 20%.</p>\r\n<p>\r\n	Pin nhanh chai là do bạn sạc pin máy tính quá nhiều lần và nó đã đạt đến 1000 lần hay vượt quá xa. Hãy xem để biết cách sạc cho <strong>pin máy tính laptop Asus</strong> mới mua nhé!</p>\r\n<p>\r\n	Pin nhanh chai là do bạn lâu quá không chịu xả pin về 10% rồi mới xạc đầy dùng tiếp.</p>\r\n<p>\r\n	Pin nhanh chai nhất là do bạn vừa sạc pin vừa xả pin (sử dụng máy tính lúc nó đang sạc pin). Ở phần sau mình sẽ chỉ bạn cách tránh trường hợp này.</p>\r\n<h2>\r\n	&nbsp;</h2>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">3. Đầu tiên bạn phải nắm được nguyên lý hoạt động của pin để biết cách sạc cho pin máy tính laptop Asus mới mua đúng cách</span></h2>\r\n<p>\r\n	Với những máy tính được trang bị công nghệ pin Li-ion thông minh:</p>\r\n<p>\r\n	Pin sẽ tự động ngắt sạc khi đạt 100%, lúc này máy tính sẽ chuyển sang sử dụng năng lượng điện trực tiếp từ cục sạc chứ không sử dụng năng lượng từ pin. Bạn sử dụng máy tính vào lúc này thì pin sẽ không bị chai.</p>\r\n<p>\r\n	Hàng ngày pin sẽ tụt khoảng 1% (do tính năng chạy ngầm của hệ thống, có thể sau khi tắt máy tính một số chương trình như đồng hồ vẫn hoạt động, hao hụt khác...) đến khi nào nó tụt xuống 94% thì pin mới tiếp tục kết nối với sạc để sạc đầy trở lại 100%. Sử dụng máy tính trong khoảng thời gian pin còn (95% - 100%) này thì pin không bị chai.</p>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">4. Vậy sạc, xả <strong>pin máy tính laptop Asus</strong> như thế nào là đúng cách</span></h2>\r\n<p>\r\n	Máy tính mới sau khi đã sạc đủ 3 lần 8 tiếng như hướng dẫn ở mục 1, tiếp đến bạn sẽ thực hiện như sau:</p>\r\n<p>\r\n	Ở lần sạc 8 tiếng cuối cùng pin sẽ đạt 100% lúc này bạn có thể cắm sạc vào và sử dụng bình thường, lúc này máy tính sẽ sử dụng năng lượng điện trực tiếp từ sạc chứ không đá động gì đến pin cả nên không lo bị chai pin.</p>\r\n<p>\r\n	Nhưng bạn hãy chú ý hàng ngày pin có thể tụt khoảng 1% như đã nó ở trên, nên khi nào pin còn khoảng 95%, 96% (khoảng 5 ngày) là bạn phải tiến hành xả pin ngay, tức là tháo sạc pin ra và sử dụng máy tính bình thường, đến khi nào máy báo pin còn 10% thì lại gắn sạc tiếp 8 tiếng để pin đầy 100%. Nếu bạn không tháo sạc pin vào lúc này thì khi pin tụt còn 94% nó sẽ tự động sạc tiếp, lúc này máy vừa sạc pin vừa xả pin (bạn đang sử dụng mà) nên pin chai rất nhanh. Mặc khác bạn cũng nên xả pin (không cắm sạc mà sử dụng năng lượng trực tiếp từ pin) sau khoảng 1 - 2 tuần như thế để số cell còn lại trong pin được sử dụng tránh để lâu không sử dụng đến nó cũng sẽ bị hư.</p>\r\n<p>\r\n	Hy vọng với <strong>4 cách sạc pin laptop Asus</strong> nêu trên sẽ giúp bạn bảo vệ chiếc máy tính của mình một cách tốt nhất. Nếu còn bất cứ thắc mắc hay những vấn đề về pin máy tính laptop của bạn hãy liên hệ ngay với chúng tôi. Chúng tôi luôn luôn giúp đỡ các bạn!</p>\r\n<h3>\r\n	<span style=\"color:#0000ff;\">Video hướng dẫn sạc pin&nbsp;laptop Asus mới mua</span></h3>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/SJRnJvCIMX8\" width=\"685\"></iframe></p>\r\n<h4>\r\n	<span style=\"color:#0000ff;\">Chúc các bạn làm việc hiệu quả!</span></h4>\r\n<p>\r\n	<span style=\"color:#0000ff;\">Các bài viết liên quan:</span></p>\r\n<p>\r\n	<em style=\"color: rgb(0, 0, 255); font-family: \'times new roman\', times, serif;\">Cách khắc phục lỗi pin laptop bị gạch chéo window 7</em></p>\r\n<h3>\r\n	<span style=\"font-family:times new roman,times,serif;\"><a href=\"http://saclaptop.net/pin-battery-laptop-asus/lp111.html\" style=\"font-size: 13px; color: rgb(22, 84, 3); text-decoration: none !important;\"><span style=\"color:#0000ff;\">Pin (Battery) Laptop Asus</span></a></span></h3>\r\n<h3>\r\n	&nbsp;</h3>\r\n<p>\r\n	&nbsp;</p>\r\n', 'http://saclaptop.net/img/news/pin%20laptop.jpg', '/img/news/Pin-laptop moi.jpg', '', 5, 105, 0, 'Cách sạc pin laptop Asus mới mua bạn nên biết,Cách sạc pin laptop mới mua,Cách sạc pin laptop dell mới mua,Cách sạc pin laptop hp mới mua,Cách sạc pin laptop acer mới mua.', 'cách khắc phục lỗi pin laptop bị gạch chéo  sạc pin không vào điện pin không lưu được điện liên hệ 0989710690 để tư vấn hỗ trợ miễ