(17, 43, 'vi', 'Cách sạc pin laptop Hp mới mua bạn nên biết', 'cach-sac-pin-laptop-hp-moi-mua-ban-nen-biet', '<h1>\r\n	<span style=\"color:#0000ff;\"><strong>Cách sạc pin laptop HP mới mua bạn nên biết</strong></span></h1>\r\n<p>\r\n	Vấn đề sử dụng <a href=\"http://saclaptop.net/pin-battery-laptop-hp/lp123.html\"><span style=\"color:#0000ff;\"><strong>pin máy tính laptop HP </strong></span></a>hiện đang là 1 trong các câu hỏi thông dụng được khá nhiều các bạn quan tâm đến hiện nay. Có nhiều bạn khi mua máy tính mới về nếu không biết cách sử dụng <strong>và cách bảo vệ pin laptop Asus</strong> thì sẽ bị hư 1 cách nhanh chóng. Vì hầu hết các máy tính Asus thế hệ mới bây giờ đều được trang bị viên pin liền, không thể tháo rời, nếu lỡ pin bị chai quá nhanh thì việc thay thế pin mới vào rất khó khăn. Để giúp mọi người có thể sử dụng pin hôm nay chúng tôi xin chia sẻ tới các bạn cách sử dụng <strong>pin máy tính laptop asus</strong> đúng cách.</p>\r\n<h2>\r\n	<span style=\"font-size:16px;\"><span style=\"color:#0000ff;\">1. Cách sạc <strong>pin máy tính laptop HP </strong>khi mới mua về</span></span></h2>\r\n<p>\r\n	Khi bạn mới mua máy tính bạn nên sạc pin 3 lần, mỗi lần 8 tiếng. Nghĩa là lần đầu tiên bạn sạc 8 tiếng rồi tháo sạc pin ra, sử dụng máy tính đến khi nào máy báo còn 10% pin thì bạn sạc tiếp 8 tiếng nữa, cứ sạc, xả pin như thế trong 3 lần sau đó mới chuyển sang sử dụng máy tính bình thường. Mục đích của việc này là giúp cho pin máy tính được trở về trạng thái hoạt động bình thường, lâu hết pin và lâu bị chai, hư pin.</p>\r\n<p>\r\n	<img alt=\"\" src=\"/app/webroot/img/ck/tin%20t%E1%BB%A9c/Pin-laptop%20moi.jpg\" style=\"width: 344px; height: 155px;\" /><img alt=\"\" src=\"/app/webroot/img/ck/tin%20t%E1%BB%A9c/pin%20laptop%20moi%202.jpg\" style=\"width: 344px; height: 241px;\" /></p>\r\n<h2>\r\n	&nbsp;</h2>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">2. Tại sao pin laptop HP nhanh chai?</span></h2>\r\n<p>\r\n	Khi bạn sạc pin từ 800 đến 1000 lần thì pin sẽ bị chai khoảng 20%, tức là thời gian sử dụng pin giảm đi 20%.</p>\r\n<p>\r\n	Pin nhanh chai là do bạn sạc pin máy tính quá nhiều lần và nó đã đạt đến 1000 lần hay vượt quá xa. Hãy xem để biết cách sạc cho <strong>pin máy tính laptop Asus</strong> mới mua nhé!</p>\r\n<p>\r\n	Pin nhanh chai là do bạn lâu quá không chịu xả pin về 10% rồi mới xạc đầy dùng tiếp.</p>\r\n<p>\r\n	Pin nhanh chai nhất là do bạn vừa sạc pin vừa xả pin (sử dụng máy tính lúc nó đang sạc pin). Ở phần sau mình sẽ chỉ bạn cách tránh trường hợp này.</p>\r\n<h2>\r\n	&nbsp;</h2>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">3. Đầu tiên bạn phải nắm được nguyên lý hoạt động của pin để biết cách sạc cho pin máy tính laptop HP mới mua đúng cách</span></h2>\r\n<p>\r\n	Với những máy tính được trang bị công nghệ pin Li-ion thông minh:</p>\r\n<p>\r\n	Pin sẽ tự động ngắt sạc khi đạt 100%, lúc này máy tính sẽ chuyển sang sử dụng năng lượng điện trực tiếp từ cục sạc chứ không sử dụng năng lượng từ pin. Bạn sử dụng máy tính vào lúc này thì pin sẽ không bị chai.</p>\r\n<p>\r\n	Hàng ngày pin sẽ tụt khoảng 1% (do tính năng chạy ngầm của hệ thống, có thể sau khi tắt máy tính một số chương trình như đồng hồ vẫn hoạt động, hao hụt khác...) đến khi nào nó tụt xuống 94% thì pin mới tiếp tục kết nối với sạc để sạc đầy trở lại 100%. Sử dụng máy tính trong khoảng thời gian pin còn (95% - 100%) này thì pin không bị chai.</p>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">4. Vậy sạc, xả <strong>pin máy tính laptop HP </strong>như thế nào là đúng cách</span></h2>\r\n<p>\r\n	Máy tính mới sau khi đã sạc đủ 3 lần 8 tiếng như hướng dẫn ở mục 1, tiếp đến bạn sẽ thực hiện như sau:</p>\r\n<p>\r\n	Ở lần sạc 8 tiếng cuối cùng pin sẽ đạt 100% lúc này bạn có thể cắm sạc vào và sử dụng bình thường, lúc này máy tính sẽ sử dụng năng lượng điện trực tiếp từ sạc chứ không đá động gì đến pin cả nên không lo bị chai pin.</p>\r\n<p>\r\n	Nhưng bạn hãy chú ý hàng ngày pin có thể tụt khoảng 1% như đã nó ở trên, nên khi nào pin còn khoảng 95%, 96% (khoảng 5 ngày) là bạn phải tiến hành xả pin ngay, tức là tháo sạc pin ra và sử dụng máy tính bình thường, đến khi nào máy báo pin còn 10% thì lại gắn sạc tiếp 8 tiếng để pin đầy 100%. Nếu bạn không tháo sạc pin vào lúc này thì khi pin tụt còn 94% nó sẽ tự động sạc tiếp, lúc này máy vừa sạc pin vừa xả pin (bạn đang sử dụng mà) nên pin chai rất nhanh. Mặc khác bạn cũng nên xả pin (không cắm sạc mà sử dụng năng lượng trực tiếp từ pin) sau khoảng 1 - 2 tuần như thế để số cell còn lại trong pin được sử dụng tránh để lâu không sử dụng đến nó cũng sẽ bị hư.</p>\r\n<p>\r\n	Hy vọng với <strong>4 cách sạc pin laptop Asus</strong> nêu trên sẽ giúp bạn bảo vệ chiếc máy tính của mình một cách tốt nhất. Nếu còn bất cứ thắc mắc hay những vấn đề về pin máy tính laptop của bạn hãy liên hệ ngay với chúng tôi. Chúng tôi luôn luôn giúp đỡ các bạn!</p>\r\n<h3>\r\n	<span style=\"color:#0000ff;\">Video hướng dẫn sạc pin&nbsp;laptop HP mới mua</span></h3>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/SJRnJvCIMX8\" width=\"685\"></iframe></p>\r\n<h4>\r\n	<span style=\"color:#0000ff;\">Chúc các bạn làm việc hiệu quả!</span></h4>\r\n<p>\r\n	<span style=\"color:#0000ff;\">Các bài viết liên quan:</span></p>\r\n<p>\r\n	<em style=\"color: rgb(0, 0, 255); font-family: \'times new roman\', times, serif;\">Cách khắc phục lỗi pin laptop bị gạch chéo window 7</em></p>\r\n<h3>\r\n	<a href=\"http://saclaptop.net/pin-battery-laptop-hp/lp123.html\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"font-size: 13px; color: rgb(22, 84, 3); text-decoration: none !important;\"><span style=\"color:#0000ff;\">Pin (Battery) Laptop HP</span></span></span></a></h3>\r\n<h3>\r\n	&nbsp;</h3>\r\n<p>\r\n	&nbsp;</p>\r\n', '', '1', 'Cách sạc pin laptop hp mới mua bạn nên biết,Cách sạc pin laptop mới mua,Cách sạc pin laptop dell mới mua,Cách sạc pin laptop asus mới mua,Cách sạc pin laptop acer mới mua.', 'cách khắc phục lỗi pin laptop bị gạch chéo  sạc pin không vào điện pin không lưu được điện liên hệ 0989710690 để tư vấn hỗ trợ miễn phí  ', NULL, NULL),
