,Cách sạc pin laptop acer mới mua.', 'cách khắc phục lỗi pin laptop bị gạch chéo  sạc pin không vào điện pin không lưu được điện liên hệ 0989710690 để tư vấn hỗ trợ miễn phí  ', NULL, NULL),
(21, 47, 'vi', 'Cách sạc pin laptop samsung mới mua bạn nên biết', 'cach-sac-pin-laptop-samsung-moi-mua-ban-nen-biet', '<h1>\r\n	<span style=\"color:#0000ff;\"><strong>Cách sạc pin laptop Samsung mới mua bạn nên biết</strong></span></h1>\r\n<p>\r\n	Vấn đề sử dụng <a href=\"http://saclaptop.net/pin-battery-laptop-samsung/lp126.html\"><span style=\"color:#0000ff;\"><strong>pin máy tính laptop</strong><strong> samsung</strong></span></a><span style=\"color:#0000ff;\"> </span>hiện đang là 1 trong các câu hỏi thông dụng được khá nhiều các bạn quan tâm đến hiện nay. Có nhiều bạn khi mua máy tính mới về nếu không biết cách sử dụng <strong>và cách bảo vệ pin laptop Asus</strong> thì sẽ bị hư 1 cách nhanh chóng. Vì hầu hết các máy tính Asus thế hệ mới bây giờ đều được trang bị viên pin liền, không thể tháo rời, nếu lỡ pin bị chai quá nhanh thì việc thay thế pin mới vào rất khó khăn. Để giúp mọi người có thể sử dụng pin hôm nay chúng tôi xin chia sẻ tới các bạn cách sử dụng <strong>pin máy tính laptop asus</strong> đúng cách.</p>\r\n<h2>\r\n	<span style=\"font-size:16px;\"><span style=\"color:#0000ff;\">1. Cách sạc <strong>pin máy tính laptop Samsung </strong>khi mới mua về</span></span></h2>\r\n<p>\r\n	Khi bạn mới mua máy tính bạn nên sạc pin 3 lần, mỗi lần 8 tiếng. Nghĩa là lần đầu tiên bạn sạc 8 tiếng rồi tháo sạc pin ra, sử dụng máy tính đến khi nào máy báo còn 10% pin thì bạn sạc tiếp 8 tiếng nữa, cứ sạc, xả pin như thế trong 3 lần sau đó mới chuyển sang sử dụng máy tính bình thường. Mục đích của việc này là giúp cho pin máy tính được trở về trạng thái hoạt động bình thường, lâu hết pin và lâu bị chai, hư pin.</p>\r\n<p>\r\n	<img alt=\"\" src=\"/app/webroot/img/ck/tin%20t%E1%BB%A9c/Pin-laptop%20moi.jpg\" style=\"width: 344px; height: 155px;\" /><img alt=\"\" src=\"/app/webroot/img/ck/tin%20t%E1%BB%A9c/pin%20laptop%20moi%202.jpg\" style=\"width: 344px; height: 241px;\" /></p>\r\n<h2>\r\n	&nbsp;</h2>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">2. Tại sao pin laptop Samsung nhanh chai?</span></h2>\r\n<p>\r\n	Khi bạn sạc pin từ 800 đến 1000 lần thì pin sẽ bị chai khoảng 20%, tức là thời gian sử dụng pin giảm đi 20%.</p>\r\n<p>\r\n	Pin nhanh chai là do bạn sạc pin máy tính quá nhiều lần và nó đã đạt đến 1000 lần hay vượt quá xa. Hãy xem để biết cách sạc cho <strong>pin máy tính laptop Asus</strong> mới mua nhé!</p>\r\n<p>\r\n	Pin nhanh chai là do bạn lâu quá không chịu xả pin về 10% rồi mới xạc đầy dùng tiếp.</p>\r\n<p>\r\n	Pin nhanh chai nhất là do bạn vừa sạc pin vừa xả pin (sử dụng máy tính lúc nó đang sạc pin). Ở phần sau mình sẽ chỉ bạn cách tránh trường hợp này.</p>\r\n<h2>\r\n	&nbsp;</h2>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">3. Đầu tiên bạn phải nắm được nguyên lý hoạt động của pin để biết cách sạc cho pin máy tính laptop Samsung mới mua đúng cách</span></h2>\r\n<p>\r\n	Với những máy tính được trang bị công nghệ pin Li-ion thông minh:</p>\r\n<p>\r\n	Pin sẽ tự động ngắt sạc khi đạt 100%, lúc này máy tính sẽ chuyển sang sử dụng năng lượng điện trực tiếp từ cục sạc chứ không sử dụng năng lượng từ pin. Bạn sử dụng máy tính vào lúc này thì pin sẽ không bị chai.</p>\r\n<p>\r\n	Hàng ngày pin sẽ tụt khoảng 1% (do tính năng chạy ngầm của hệ thống, có thể sau khi tắt máy tính một số chương trình như đồng hồ vẫn hoạt động, hao hụt khác...) đến khi nào nó tụt xuống 94% thì pin mới tiếp tục kết nối với sạc để sạc đầy trở lại 100%. Sử dụng máy tính trong khoảng thời gian pin còn (95% - 100%) này thì pin không bị chai.</p>\r\n<h2>\r\n	<span style=\"color:#0000ff;\">4. Vậy sạc, xả <strong>pin máy tính laptop samsung </strong>như thế nào là đúng cách</span></h2>\r\n<p>\r\n	Máy tính mới sau khi đã sạc đủ 3 lần 8 tiếng như hướng dẫn ở mục 1, tiếp đến bạn sẽ thực hiện như sau:</p>\r\n<p>\r\n	Ở lần sạc 8 tiếng cuối cùng pin sẽ đạt 100% lúc này bạn có thể cắm sạc vào và sử dụng bình thường, lúc này máy tính sẽ sử dụng năng lượng điện trực tiếp từ sạc chứ không đá động gì đến pin cả nên không lo bị chai pin.</p>\r\n<p>\r\n	Nhưng bạn hãy chú ý hàng ngày pin có thể tụt khoảng 1% như đã nó ở trên, nên khi nào pin còn khoảng 95%, 96% (khoảng 5 ngày) là bạn phải tiến hành xả pin ngay, tức là tháo sạc pin ra và sử dụng máy tính bình thường, đến khi nào máy báo pin còn 10% thì lại gắn sạc tiếp 8 tiếng để pin đầy 100%. Nếu bạn không tháo sạc pin vào lúc này thì khi pin tụt còn 94% nó sẽ tự động sạc tiếp, lúc này máy vừa sạc pin vừa xả pin (bạn đang sử dụng mà) nên pin chai rất nhanh. Mặc khác bạn cũng nên xả pin (không cắm sạc mà sử dụng năng lượng trực tiếp từ pin) sau khoảng 1 - 2 tuần như thế để số cell còn lại trong pin được sử dụng tránh để lâu không sử dụng đến nó cũng sẽ bị hư.</p>\r\n<p>\r\n	Hy vọng với <strong>4 cách sạc pin laptop Asus</strong> nêu trên sẽ giúp bạn bảo vệ chiếc máy tính của mình một cách tốt nhất. Nếu còn bất cứ thắc mắc hay những vấn đề về pin máy tính laptop của bạn hãy liên hệ ngay với chúng tôi. Chúng tôi luôn luôn giúp đỡ các bạn!</p>\r\n<h3>\r\n	<span style=\"color:#0000ff;\">Video hướng dẫn sạc pin&nbsp;laptop samsung mới mua</span></h3>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/SJRnJvCIMX8\" width=\"685\"></iframe></p>\r\n<h4>\r\n	<span style=\"color:#0000ff;\">Chúc các bạn làm việc hiệu quả!</span></h4>\r\n<p>\r\n	<span style=\"color:#0000ff;\">Các bài viết liên quan:</span></p>\r\n<p>\r\n	<em style=\"color: rgb(0, 0, 255); font-family: \'times new roman\', times, serif;\">Cách khắc phục lỗi pin laptop bị gạch chéo window 7</em></p>\r\n<h3>\r\n	<a href=\"http://saclaptop.net/pin-battery-laptop-samsung/lp126.html\"><span style=\"font-family:times new roman,times,serif;\"><span style=\"font-size: 13px; color: rgb(22, 84, 3); text-decoration: none !important;\"><span style=\"color:#0000ff;\">Pin (Battery) Laptop samsung</span></span></span></a></h3>\r\n<h3>\r\n	&nbsp;</h3>\r\n<p>\r\n	&nbsp;</p>\r\n', '', '1', 'Cách sạc pin laptop samsung mới mua bạn nên biết,Cách sạc pin laptop mới mua,Cách sạc pin laptop dell mới mua,Cách sạc pin laptop hp mới mua,Cách sạc pin laptop acer mới mua.', 'cách khắc phục lỗi pin laptop bị gạch chéo  sạc pin không vào điện pin không lưu được điện liên hệ 0989710690 để tư vấn hỗ trợ miễn phí  ', NULL, NULL),
(22, 48, 'vi', 'Bão số 3-bão Thần sét giật cấp 14 đang tiến vào Quảng Ninh- Thanh Hóa (cập nhật)', 'bao-so-3-bao-than-set-giat-cap-14-dang-tien-vao-quang-ninh-thanh-hoa-cap-nhat', '<h2>\r\n	Bão số 3-bão Thần sét giật cấp 14 đang tiến vào Quảng Ninh- Thanh Hóa (cập nhật)</h2>\r\n<h3>\r\n	<span style=\"margin: 0px; padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: notib, arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; font-size: 15px; line-height: 23px; color: rgb(0, 0, 0);\">Tin tức mới nhất cơn bão số 3</span></h3>\r\n<p>\r\n	<span style=\"margin: 0px; padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: notib, arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; font-size: 15px; line-height: 23px; color: rgb(0, 0, 0);\">Áp thấp nhiệt đới trên Biển Đông mạnh lên thành bão- cơn bão số 3- bão Dianmu. Dự báo cơn bão số 3 giật cấp 10-12, di chuyển chủ yếu theo hướng Tây, mỗi giờ đi được khoảng 5-10km và còn tiếp tục mạnh thêm.</span><span style=\"font-family: notib, arial; color: rgb(0, 0, 0); font-size: 15px; line-height: 23px;\">Tin bão số 3 mới nhất, bão số 3 giật cấp 12 chuẩn bị đổ bộ vào đất liền</span></p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Tin bão số 3 mới nhất từ Trung tâm Khí tượng Thủy văn Trung ương, vào hồi 16 giờ ngày 18/8, vị trí tâm bão số 3 ở vào khoảng 20,6 độ Vĩ Bắc; 110,0 độ Kinh Đông, trên khu vực bán đảo Lôi Châu (Trung Quốc).</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Sức gió mạnh nhất ở vùng gần tâm bão mạnh cấp 8-9 (60-90km/giờ), giật cấp 10-12.&nbsp;Dự báo trong 12 giờ tới, bão di chuyển theo hướng Tây Tây Nam, mỗi giờ đi được khoảng 15-20km, đi vào vùng biển Bắc Vịnh Bắc Bộ và còn tiếp tục mạnh thêm.</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Đến 04 giờ ngày 19/8, vị trí tâm bão ở vào khoảng 20,4 độ Vĩ Bắc; 108,2 độ Kinh Đông, trên vùng biển Bắc Vịnh Bắc Bộ. Sức gió mạnh nhất ở vùng gần tâm bão mạnh cấp 10 (90-100km/giờ), giật cấp 12-14.&nbsp;Từ tối nay (18/8), do ảnh hưởng của hoàn lưu bão, ở Vịnh Bắc Bộ (bao gồm các huyện đảo Bạch Long Vĩ, Cát Hải, Cô Tô, Vân Đồn) gió sẽ mạnh dần lên cấp 6-8, vùng gần tâm bão đi qua mạnh cấp 9-10, giật cấp 12-14, sóng biển cao từ 4-6m. Biển động rất mạnh. Cấp độ rủi ro thiên tai cấp 3.&nbsp;</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Trong 12 đến 24 giờ tiếp theo, bão di chuyển theo hướng Tây Tây Nam, mỗi giờ đi được khoảng 15-20km, đi vào đất liền với sức gió mạnh nhất cấp 10, ảnh hưởng trực tiếp đến các tỉnh phía Đông Bắc Bộ và Bắc Trung Bộ. Sức gió mạnh nhất ở vùng vùng gần tâm bão đi qua mạnh cấp 9-10, giật cấp 12-14.&nbsp;Đến 16 giờ ngày 19/8, vị trí tâm bão ở vào khoảng 20,3 độ Vĩ Bắc; 105,8 độ Kinh Đông, trên đất liền các tỉnh phía Đông Bắc Bộ và Thanh Hóa.&nbsp;</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Từ sáng mai (19/8), khu vực các tỉnh Quảng Ninh, Hải Phòng, Thái Bình, Nam Định, Ninh Bình, Thanh Hóa có gió mạnh dần lên cấp 8-10, giật cấp 12-14. Các nơi khác thuộc vùng đồng bằng, trung du Bắc Bộ và Nghệ An, Hà Tĩnh có gió mạnh cấp 6-7, giật cấp 8-11. Vùng ven biển từ Nam Quảng Ninh đến Nam Định có nước dâng bão kết hợp thủy triều cao 3-4m. Cấp độ rủi ro thiên tai cấp 3.&nbsp;</p>\r\n<h2 style=\"margin: 0px; padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; font-weight: normal; color: rgb(0, 0, 0); font-size: 15px !important; line-height: 23px !important;\">\r\n	<span style=\"margin: 0px; padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: notib, arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px;\">Bão số 3- bão Thần sét tăng cấp, di chuyển nhanh vào Quảng Ninh- Thanh Hóa</span></h2>\r\n<p>\r\n	<img alt=\"\" src=\"/app/webroot/img/ck/tintuc/20160817-045308-1_750x454.gif\" style=\"width: 690px; height: 418px;\" /></p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-family: notib, arial; font-size: 15px; line-height: 23px; text-align: center; background-color: rgb(245, 245, 245);\">Bão số 3- bão Dianmu sẽ đổ bộ vào Quảng Ninh đến Nghệ An.Ảnh VOV</span></p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Tin bão số 3 mới nhất, vào hồi 14 giờ ngày 18/8, vị trí tâm bão số 3 ở vào khoảng 21,0 độ Vĩ Bắc; 110,8 độ Kinh Đông, trên vùng biển phía Đông bán đảo Lôi Châu (Trung Quốc). Sức gió mạnh nhất ở vùng gần tâm bão mạnh cấp 8-9 (60-90km/giờ), giật cấp 10-12.&nbsp;</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Dự báo trong 12 giờ tới, bão số 3 di chuyển theo hướng Tây Tây Nam, mỗi giờ đi được khoảng 15-20km, đi vào vùng biển Bắc Vịnh Bắc Bộ và còn tiếp tục mạnh thêm. Đến 01 giờ ngày 19/8, vị trí tâm bão ở vào khoảng 20,7 độ Vĩ Bắc; 108,7 độ Kinh Đông, trên vùng biển Bắc Vịnh Bắc Bộ. Sức gió mạnh nhất ở vùng gần tâm bão mạnh cấp 10 (90-100km/giờ), giật cấp 12-14. Do ảnh hưởng của hoàn lưu cơn bão số 3, ở Vịnh Bắc Bộ (bao gồm các huyện đảo Bạch Long Vĩ, Cát Hải, Cô Tô, Vân Đồn) gió sẽ mạnh dần lên cấp 6-8, vùng gần tâm cơn bão số 3 đi qua mạnh cấp 9-10, giật cấp 12-14, sóng biển cao từ 4-6m. Biển động rất mạnh. Cấp độ rủi ro thiên tai cấp 3.&nbsp;Trong 12 đến 24 giờ tiếp theo, bão di chuyển theo hướng Tây Tây Nam, mỗi giờ đi được khoảng 15-20km, ảnh hưởng trực tiếp đến các tỉnh phía Đông Bắc Bộ và Bắc Trung Bộ.</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	Đến 13 giờ ngày 19/8, vị trí tâm bão số 3 ở vào khoảng 20,4 độ Vĩ Bắc; 106,5 độ Kinh Đông, trên vùng bờ biển Quảng Ninh-Thanh Hóa. Sức gió mạnh nhất ở vùng gần tâm bão mạnh cấp 10 (90-100km/giờ), giật cấp 12-14.&nbsp;Từ sáng mai (19/8), khu vực các tỉnh Quảng Ninh, Hải Phòng, Thái Bình, Nam Định, Ninh Bình, Thanh Hóa có gió mạnh dần lên cấp 8-10, giật cấp 12-14. Các nơi khác thuộc phía Đông Bắc Bộ, Nghệ An, Hà Tĩnh có gió mạnh cấp 6-7, giật cấp 8-11. Vùng ven biển từ Nam Quảng Ninh đến Nam Định có nước dâng bão kết hợp thủy triều cao 3-4m. Cấp độ rủi ro thiên tai cấp 3.&nbsp;</p>\r\n<p style=\"padding: 0px; list-style: none; text-rendering: optimizeLegibility; font-family: arial; -webkit-font-smoothing: antialiased; text-shadow: rgba(0, 0, 0, 0.00392157) 1px 1px 1px; color: rgb(0, 0, 0); margin: 5px auto 15px !important; font-size: 15px !important; line-height: 23px !important;\">\r\n	<a href=\"http://===&gt;Sạc laptop Toshiba 19V - 3.42A\" style=\"font-family: notib, arial;\">Sạc laptop Toshiba 19V - 3.42A</a></p>\r\n', '', '0', 'Tin bão số 3 năm 2016,Bão số 3 đổ bộ vào miền bắc,Bão số 3 đổ bộ vào Hà Nội,tin mới nhất của cơn bão số 3,bão số 3 sẽ đi vào đâu,tầm ảnh hưởng của cơn bão số 3,', 'Từ sáng mai (19/8), khu vực các tỉnh Quảng Ninh, Hải Phòng, Thái Bình, Nam Định, Ninh Bình, Thanh Hóa có gió mạnh dần lên cấp 8-10, giật cấp 12-14. ', NULL, NULL),
(23, 51, 'vi', 'Thất Tình -Trịnh Đình Quang', 'that-tinh-trinh-dinh-quang', '<p class=\"info-content otr\">123</p>', '45', '0', NULL, NULL, NULL, '2018-03-07 04:24:08'),
(24, 52, 'vi', 'THÔNG BÁO: CHUYỂN ĐỊA ĐIỂM', 'thong-bao-chuyen-dia-diem', '<h3 style=\"margin: 10px 0px; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; line-height: 40px; color: rgb(51, 51, 51); text-rendering: optimizeLegibility; font-size: 24px;\">\r\n	THÔNG BÁO: CHUYỂN ĐỊA ĐIỂM</h3>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<strong><em>Công ty TNHH Kinh Doanh Thương Mại và Dịch Vụ Tân Thành chân thành cảm ơn sự ủng hộ, giúp đỡ quý báu của quý khách hàng và quý đối tác đã dành cho chúng tôi trong thời gian qua.</em></strong></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<a href=\"http://pinsaclaptop.vn/thong-bao-chuyen-dia-diem_n109.htm\" style=\"color: rgb(68, 68, 68); text-decoration: none;\" title=\"Thông báo, chuyển địa điểm\"><img alt=\"\" src=\"http://pinsaclaptop.vn/UserFiles/RadEditor/News/Images/OtherSite/109chuyen%20dia%20diem1.jpg\" style=\"height: auto; max-width: 100%; vertical-align: middle; border: 0px;\" /></a></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Do nhu cầu phát triền của công ty và mục đích phục vụ, chăm sóc khách hàng được tốt hơn.  </p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Vì vậy, bắt đầu từ ngày 10/10/2016. Cty chúng tôi sẽ chuyển địa điểm đặt trụ sở công ty từ địa chỉ cũ:</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<strong><span style=\"color: rgb(0, 32, 96);\">Số 10A, ngõ 98 Thái Hà, Láng Hạ, Đống Đa, Hà Nội</span></strong></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Sang địa chỉ mới ở:</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<strong><span style=\"font-size: 16px; color: rgb(255, 0, 0);\">Số 20, ngõ 95, Chùa Bộc, Trung Liệt, Đống Đa, hà Nội</span></strong></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Mọi thông tin khác vẫn giữ nguyên. Rất mong tiếp tục nhận được sự hợp tác, ủng hộ và giúp đỡ của quý khách hàng và đối tác !</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<em><strong>Xin chân thành cảm ơn !</strong></em></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	<strong><span style=\"text-decoration: underline;\">Mọi chi tiết xin liên hệ :</span></strong></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Công Ty TNHH Kinh Doanh Thương Mại và Dịch Vụ Tân Thành</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	 Địa chỉ giao dịch:  Số 20, Ngõ 95 Chùa Bộc - Đống Đa - Hà Nội</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	ĐT: 043.546.3362 - Fax: 043.546.3360  - Hotline : 0123.647.5555</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Website:<span style=\"text-decoration: underline;\"> </span> <a href=\"http://pinsaclaptop.vn/\" style=\"color: rgb(68, 68, 68); text-decoration: none;\" target=\"_blank\">http://pinsaclaptop.vn/</a></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	                <span style=\"text-decoration: underline;\"><a href=\"http://www.thitruongit.vn/\" style=\"color: rgb(68, 68, 68); text-decoration: none;\" target=\"_blank\">http://thitruongit.vn/</a></span></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	                http://saclaptop.net/</p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	                <a href=\"http://tanthanh.company/\" style=\"color: rgb(68, 68, 68); text-decoration: none;\" target=\"_blank\">http://tanthanh.company</a></p>\r\n<p style=\"margin: 0px 0px 10px; color: rgb(51, 51, 51); font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 14px;\">\r\n	Email: <a href=\"mailto:thitruongit.vn@gmail.com\" style=\"color: rgb(68, 68, 68); text-decoration: none;\" target=\"_blank\">thitruongit.vn@gmail.com</a></p>', NULL, '0', NULL, NULL, NULL, '2018-03-24 07:48:13'),
