ize: 13px; line-height: 20px;\">\r\n	<strong>+ Không bán hàng nhái. hàng chất lượng kém. gây ảnh hưởng tới máy trong quá trình sử dụng</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<strong>+ Bảo hành nhanh, nghiêm túc</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<strong>Dịch vụ:</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<strong>+ Giao hàng và lắp đặt tận nhà hoàn toàn miến phí trong nội thành Hà Nội</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<strong>+ Hỗ trợ 50% chi phí vận chuyển đối với khách hàng ở các tỉnh ngoài Hà Nội</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	&nbsp;</p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px; clear: both;\">\r\n	<strong><em>Mọi yêu cầu đặt hàng và hỗ trợ tư vấn quý khách vui lòng liên hệ qua số:</em>&nbsp;0989710690</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px; clear: both;\">\r\n	<strong>Các dòng mày tương thích</strong></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px; clear: both;\">\r\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: medium; line-height: normal; orphans: 2; text-align: -webkit-auto; widows: 2;\">AcerNote 300 Series:</span></p>\r\n<p style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; line-height: 20px;\">\r\n	<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: medium; line-height: 24px; orphans: 2; widows: 2;\"><span style=\"color: rgb(0, 0, 0); line-height: normal; text-align: -webkit-auto;\">330t 350 350c 350E 350P 350PC 352 355 356 358 361 368