(9, 62, 'vi', 'Sạc  Macbook 85w 2010 |  Sạc  Macbook  85W MagSafe1 ', 'sac-macbook-85w-2010-sac-macbook-85w-magsafe1', '<h2>\r\n	Sạc &nbsp;Macbook 85w 2010 | &nbsp;Sạc &nbsp;Macbook &nbsp;85W MagSafe1&nbsp;</h2>\r\n<p>\r\n	<img alt=\"Sạc  Macbook 85w 2010 |  Sạc  Macbook  85W MagSafe1 \" class=\"Sạc  Macbook 85w 2010 |  Sạc  Macbook  85W MagSafe1 \" id=\"Sạc  Macbook 85w 2010 |  Sạc  Macbook  85W MagSafe1 \" src=\"/app/webroot/img/ck/S%E1%BA%A1c%20Laptop%20Laptop%20Dell%20(2).jpg\" style=\"width: 690px; height: 690px;\" title=\"Sạc  Macbook 85w 2010 |  Sạc  Macbook  85W MagSafe1 \" /></p>\r\n<h3>\r\n	<strong>M&ocirc; tả sản ph&acirc;̉m&nbsp;</strong>Sạc &nbsp;Macbook 85w 2010 | &nbsp;Sạc &nbsp;Macbook &nbsp;85W MagSafe1&nbsp;<strong style=\"font-size: 12px;\">&nbsp;:</strong></h3>\r\n<ul style=\"list-style-type: square;\">\r\n	<li>\r\n		Sản ph&acirc;̉m<em><strong>&nbsp;</strong></em>&nbsp;được&nbsp; nh&acirc;̣p kh&acirc;̉u và ph&acirc;n ph&ocirc;́i bởi c&ocirc;ng ty chúng t&ocirc;i .</li>\r\n	<li>\r\n		Sản ph&acirc;̉m&nbsp;Sạc macbook &nbsp; là sản ph&acirc;̉m mới 100%.</li>\r\n	<li>\r\n		Sạc&nbsp;macbook &nbsp;&nbsp;đã được c&ocirc;ng ty chúng t&ocirc;i ki&ecirc;̉m định ch&acirc;́t lượng</li>\r\n	<li>\r\n		Sản ph&acirc;̉m đảm bảo an toàn trong quá trình sử dụng .</li>\r\n	<li>\r\n		Sản ph&acirc;̉m sạc&nbsp; có thi&ecirc;́t bị tự ngắt với dòng đi&ecirc;̣n quá cao .</li>\r\n	<li>\r\n		C&ocirc;ng ty t&ocirc;i cam k&ecirc;́t sản phẩm hoàn toàn phù hợp 100% máy của&nbsp; bạn .</li>\r\n	<li>\r\n		Sản ph&acirc;̉m sạc&nbsp;&nbsp;macbook &nbsp;&nbsp;đã bao&nbsp; g&ocirc;̀m box&nbsp; và d&acirc;y ngu&ocirc;̀n</li>\r\n</ul>\r\n<h3>\r\n	Lưu &yacute; Khi mua h&agrave;ng &amp; sử dụng sản phẩm sạc&nbsp;macbook &nbsp;&nbsp;:</h3>\r\n<p>\r\n	<strong>Khi chọn mua m&ocirc;̣t chi&ecirc;́c sạc&nbsp;</strong>macbook &nbsp;<strong>bạn l&ecirc;n chọn đúng chỉ s&ocirc;́ với máy bạn</strong></p>\r\n<ul style=\"list-style-type: square;\"